import AppLayout from "../components/AppLayout";
import Head from "next";

const Profile = () => {
    return(
        <>
        <Head>
            <title>내 프로필 | sns</title>
        </Head>
        <AppLayout>
            <div>Profile</div>
        </AppLayout>
        </>
    )
}

export default Profile;
